import Card from './Card.js'

import img1 from './images/img1.jpg'
import img2 from './images/img2.jpg'
import img3 from './images/img3.jpg'


function CardIndex(){
    return(
        <div>
            <Card img={img1}
            title="first title"
            description="this is the description"/>

            <Card img={img2}
            title="second title"
            description="this is the description"/>

            <Card img={img3}
            title="third title"
            description="this is the description"/>

            <hr></hr>
        </div>
    )

}

export default CardIndex;
